Conditions on Approval:
The approved provider must
a. prepare a compliance improvement plan and submit a copy of that plan to the Regulatory Authority by 9 May 2025.
b. Ensure that the compliance improvement plan addresses the following:
i. Adequate supervision of children, consistent with section 165 of the National Law.
ii. Taking reasonable precautions to protect children from harm or hazards, consistent with section 167 of the National Law.
iii. Ensuring certain information is notified to the Regulatory Authority within prescribed timeframes, consistent with section 174 of the National Law.
c. Ensure that the Compliance Improvement Plan contains, as a minimum, the following details:
i. relevant section/regulation;
i.planned compliance improvement actions;
ii. How the provider will monitor its own compliance and improvement actions;
iii. how the provider will ensure that parent complaints are appropriately addressed;
iii. improvement action taken;
iv. date of action taken; and
v. name and signature of person taking action.
d. Submit a copy of the compliance improvement plan to the Regulatory Authority on a quarterly basis commencing on 1 October 2025, with an update on progress. The approved provider must notify all families of children enrolled at the education and care service of these conditions and provide a copy of this notification to the Regulatory Authority.
